import React from "react";
import '../css/home.css';
import clock from '../images/clock.jpg'
const Home =(prop)=> (
  <img src={clock} className="App-logo" alt="logo" />>
        <form>
          <input type="checkbox" id="box1" />
          <label htmlFor="vehicle1"> Learn programming by 12am</label><br />
          <input type="checkbox" id="box2" />
          <label htmlFor="vehicle2"> Learn how to cook by 1pm</label><br />
          <input type="checkbox" id="box3"/>
          <label htmlFor="vehicle3">Pick up the kids by 2pm</label><br />
          <input type="checkbox" id="box4" />
          <label htmlFor="vehicle4">Have lunch by 3pm</label><br />
          <input type="checkbox" id="box5"/>
          <label htmlFor="vehicle5">Go visit mum by 4pm</label><br />
        </form>
      );
  export default Home;
